import React from 'react';
//клаsсовая компонента

class ProfileStatus extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <span>{props.status}</span>
                </div>
                <div>
                    <input value={props.status}/>
                </div>
            </div>
        );
    };
}
export default ProfileStatus;
